import React from 'react'
import { Header, Footer } from '../components'
import 'bootstrap/dist/css/bootstrap.min.css'


//NavBar can be remove and add login here directly and then opens up new page with navbar

function App() {
    return (
        <div>
            <Router>
                <Header />
                    {this.props.children}
                 <Footer />
            </Router>



        </div>


    )
}

export default App
